CBRE and JLL are pleased to offer 458 Brunswick Street, Fortitude Valley For Sale. Located in Brisbane's premier mixed-use precinct, the property presents a prime redevelopment opportunity, with the following key attributes:

- 1,826sqm* site zoned MUI (mixed use);
- Suited to multi-storey residential development;
- High profile Brunswick Street address with immediate access to James Street Markets;
- Close proximity to Howard Smith Wharves, New Farm Park and Eagle Street Pier;
- Extensive 49m*  Brunswick Street frontage;
- Three street access;
- Vacant, cleared site, ready for development; and
- Located within Brisbane's foremost cultural, entertainment and lifestyle precinct.

This outstanding development opportunity is being offered For Sale via Expression of Interest closing 4pm (AEST) Thursday, 5th March 2015.

